    <script type="text/javascript">
      $(document).ready(function() {
        var completionRequirement;
        if ($(window).width() < 480) {
          completionRequirement = 0.1;
        } else {
          completionRequirement = 0.35;
        }

        var $groups = $('g');
        var completedGroups = 0;
        var showEvents = 'mouseenter click tap touch';

        var $instructions = $('#mobile-instructions');

        $groups.on(showEvents, function() {
          var $this = $(this);
          completedGroups++;
          if ($instructions.is(':visible')) {
            $instructions.animate({'opacity': '0'}, 500, function() {
              $instructions.hide();
            });
          }

          $this.find(':not(g)').css({'fill': '#FF0000', transition: "0.1s"});
          if (completedGroups > ($groups.length * completionRequirement)) {
            $groups.find(':not(g)').css({'fill': '#FF0000', transition: "1000ms"});
            $groups.off(showEvents);
          }
        })
      });
    </script>
